import Navbar from "react-bootstrap/Nav";
import { BrowserRouter as Router, Route, Switch, Link } from "react-router-dom";



const NavbarComponent = () => {
  return ( 
  <div>
    <Router>
      <Navbar>
        
        <Route path ="/learningComponent">
          <h1>Learning</h1>
          </Route>
    </Navbar>


    </Router>





  </div> );
}
 
export default NavbarComponent;
